// variables
var fallingMonument = {
//	activeItemKeys: ['bottle', 'pen', 'credit-card', 'bucket', 'lunch-box', 'fork-spoon'],
	activeItems: [{'item': 'pen'}],
	newItemProbability: 0,
	newItemTestDelay: 20,
	maxSpeed: 0.9,
	posRange: 50
}


// init objects
var items = {
	'bottle': initObject('Bottle'),
	'pen': initObject('Pen'),
	'credit-card': initObject('CreditCard'),
	'bucket': initObject('Bucket'),	
	'lunch-box': initObject('LunchBox'),	
	'fork-spoon': initObject('ForkSpoon'),	
}

// init group
var group = new THREE.Group();
scene.add( group );

setInterval(() => {
 	if(Math.random() < fallingMonument.newItemProbability) {
 		addItem(returnRandomItemDetails(), 10);
 	}
}, fallingMonument.newItemTestDelay);

// render/update function
function update( event ) {
	var time = event.time * 0.0002;

//	camera.position.x = Math.sin( time ) * 8;
//	camera.position.z = Math.cos( time ) * 8;
//	camera.lookAt( scene.position );

	for ( var i = 0; i < group.children.length; i ++ ) {
		var clone = group.children[ i ];
		clone.position.y -= clone.userData.speed;
		clone.rotation.x += 0.01;
		clone.rotation.y += 0.02;

		if ( clone.position.y < -2 * fallingMonument.posRange ) {
			group.remove(clone)
			clone.remove();
		}
	}
}

// helper functions
function initObject(name) {
	var obj = scene.getObjectByName(name);
	obj.visible = false;
	return obj
}

function returnRandomItemDetails() { 
	var itemIndex = Math.floor(Math.random() * fallingMonument.activeItems.length)
	return fallingMonument.activeItems[itemIndex];
}

function addItem(itemDetailsDict, y) {
	var source = items[itemDetailsDict.item];
	var clone = source.clone();
	clone.position.x = Math.random() * (fallingMonument.posRange - (fallingMonument.posRange / 2));
	clone.position.y = y || Math.random() * fallingMonument.posRange * 2; //20 - 10;
	clone.position.z = Math.random() * (fallingMonument.posRange - (fallingMonument.posRange / 2));
	clone.rotation.x = Math.random() * Math.PI;
	clone.rotation.y = Math.random() * Math.PI;
	clone.rotation.z = Math.random() * Math.PI;
//	let maxScale = clone.scale.x;
//	clone.scale.setScalar( maxScale * Math.random() * 0.5 + 0.15 );
	clone.scale.setScalar(itemDetailsDict.scale || 1);
	clone.userData.speed = itemDetailsDict.speed || Math.random() * fallingMonument.maxSpeed + (fallingMonument.maxSpeed / 3);
	clone.visible = true;
	group.add( clone );
}

window.fallingMonument = fallingMonument;
// start with 5 random objects
//for ( var i = 0; i < 5; i ++ ) { addItem(returnRandomItemDetails(), 10); }
